button_input.addEventListener('click', function() {

  if (input.value == '') {

    main_word.innerHTML = 'Вы не ввели слово';
    how_to_read_word.innerHTML = '';
    translation_word.innerHTML = '';
    additional_information_word.innerHTML = '';
    number_word.innerHTML = '';

    value_1.innerHTML = '';
    value_2.innerHTML = '';
    value_3.innerHTML = '';
    value_4.innerHTML = '';
    value_5.innerHTML = '';

  } else {

    for (let i = 0; i < array_of_words.length; i++) {

      if (input.value === array_of_words[i][1]) {
  
        input.value = '';
  
        main_word.innerHTML = 'Слово - ';
        how_to_read_word.innerHTML = 'Как читается - ';
        translation_word.innerHTML = 'Перевод - ';
        additional_information_word.innerHTML = 'Дополнительная информация - ';
        number_word.innerHTML = 'Строка в документе - ';

        if (window.innerWidth < 423) {

          main_word.innerHTML = 'Слово - ';
          how_to_read_word.innerHTML = 'Как чит. - ';
          translation_word.innerHTML = 'Перевод - ';
          additional_information_word.innerHTML = 'Доп. инфо. - ';
          number_word.innerHTML = 'Стр. в док. - ';


        } 

        value_1.innerHTML = array_of_words[i][1];
        value_2.innerHTML = array_of_words[i][2];
        value_3.innerHTML = array_of_words[i][3];

        if (array_of_words[i][4] == '') {
          value_4.innerHTML = 'Нет';
        } else {
          value_4.innerHTML = array_of_words[i][4];
        }
        
        value_5.innerHTML = i + 102;
 
        break;
      
      } else {
  
        main_word.innerHTML = 'В базе данных нет такого слова';
        how_to_read_word.innerHTML = '';
        translation_word.innerHTML = '';
        additional_information_word.innerHTML = '';
        number_word.innerHTML = '';

        value_1.innerHTML = '';
        value_2.innerHTML = '';
        value_3.innerHTML = '';
        value_4.innerHTML = '';
        value_5.innerHTML = '';
        
      }

    }

  }

});

